function Stores({storesArray}) {


    const cards = storesArray.map((store) => {
        console.log(store)
        return (
            <div>
                <h2>{store.name}</h2>
                <p>{store.address}</p>
            </div>
        )
    })

    return (
        <div className="info-box" >
                {cards}
        </div>
    )
}

export default Stores
